2359.source:
function onTouchMove(evt) {
    evt.stop();

    var touch = evt.touches[0];

    if(touch && touch.originalDragOffset) {
        var delta = touch.clientY - touch.originalDragOffset;
        this.setPosition(pt(0,touch.originalMenuOffset+delta));

        if(!this.isInBounds()) {
            var yPos = Math.min(0,Math.max(-this.maxScroll, this.getPosition().y));
            delta = this.getPosition().y-yPos;
            this.moveBy(pt(0,-delta/2));
        }

        var positionDelta = touch.lastTouch - touch.clientY;
        var now = new Date().valueOf();
        var timeDelta = now - touch.lastUpdate;

        timeDelta = Math.max(1, timeDelta);

        touch.lastTouch = touch.clientY;
        touch.lastUpdate = now;

        this.velocity = positionDelta*(-10 / timeDelta);
    }
    return true;

}

2363.source:
function onTouchEnd(evt) {
    var lastUpdate = new Date().valueOf();
    this.isTouched = false;
    var that = this;

    var flickingFct = function() {
        var now = new Date().valueOf();
        var delta = now - lastUpdate;
        var velo;
        that.velocity *= Math.pow(0.99, delta);
        that.moveBy(pt(0,that.velocity));
        that.stayInBounds();
        velo = that.velocity;

        lastUpdate = now;
        if((velo*velo>0.05 || !that.isInBounds()) && !that.isTouched) {
            window.setTimeout(flickingFct,10);
        }
    };

    window.setTimeout(flickingFct,10);

}

